import React from 'react'
import DataTable from 'react-data-table-component';

const columns = [
    {
        name: 'ID',
        selector: row => row.unique_id,
    },
    {
        name: 'Names',
        selector: row => row.names,
    },
    {
        name: 'Flight Risk',
        selector: row => row.risk,
    },
    {
        name: 'Monday',
        selector: row => row.day,
    },
];

const data = [
    {
        id: 1,
        unique_id: 'Beetlejuice',
        names: '1988',
        risk: '1988',
        day: '18'
    },
    {
        id: 2,
        unique_id: 'Ghostbusters',
        names: '1984',
        risk: '1988',
        day: '18'
    },
    {
        id: 3,
        unique_id: 'Ghostbusters',
        names: '1984',
        risk: '1988',
        day: '18'
    },
    {
        id: 4,
        title: 'Ghostbusters',
        year: '1984',
        risk: '1988',
        day: '18'
    },
]


const OrderTable  = () => {
  return (
    <>
    <DataTable
            columns={columns}
            data={data}
            selectableRows
        />
    </>
  )
}

export default OrderTable
